import { LOAD_DATA, SELECT_STATE, VIEW_THEME } from "../actions/types"


const initialState = {
    usData: {},
    stateData: [],
    chosenState: null,
    viewTheme: "day"
}

const covidDataReducer = (state=initialState, action) => {
    switch(action.type){
        case LOAD_DATA:

            return {
                ...state,

            }
        case SELECT_STATE:
            return{
                ...state,
            }
        case VIEW_THEME:
            return{
                ...state,
            }
        default:
            return state
    }
}

export default covidDataReducer
